https://github.com/microsoft/onnxruntime/blob/master/onnxruntime/test/perftest/ort_test_session.cc#L164

@jywu-msft With the following configuration, my program was compiled  but getting static while runtime:
```
        Ort::Env *env = new Ort::Env(ORT_LOGGING_LEVEL_WARNING, "test");
        Ort::SessionOptions session_options;
        session_options.SetIntraOpNumThreads(1);
        OrtOpenVINOProviderOptions options;
        options.device_type = "CPU_FP32";
        options.enable_vpu_fast_compile = 0;
        options.device_id = "";
        options.num_of_threads = 8;
        session_options.AppendExecutionProvider_OpenVINO(options);
        session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_EXTENDED);
        this->faceDetSes = new Ort::Session(*env, model_path, session_options);
```

Probably I don't miss anything from your onnxruntime_perf_test according to `USE_OPENVINO` option.
